export default function Dashboard() {
  return (
    <div className="box timetable">
      <div className="tab_container">
        <p className="tab">My Day</p>{/*Probably change this to a component*/}
        <p className="tab">Timetable</p>
      </div>
      <Transition_time />
      <div className="flex">
        <table id="daily_timetable">
          <tbody>
            <period_line />
          </tbody>
        </table>
      </div>
    </div>
  );
}
